import React from 'react';
import {  Wrapper, Header, H1, HorizontalScrollPage, Flexbox, ParallaxBackground, Navbar, NavItem, SmallContainer} from '../components'

import TimelineContainer from './TimelineContainer.js'
import TimelineItem from './TimelineItem.js'
import SideNav from './SideNav.js'

import bgimg from '../assets/bgimg2.jpg'
import bgimg2 from '../assets/bgimg.jpg'

class Overview extends React.Component {
	constructor( props ) {
		super(props); 
		this.state = {

		}
	}

	onSearchChange = (event) => {

	}

	render() {
		return(
		    <section>
			    <Header>
			    	<H1 big>MCU TIMELINE</H1>		    	
			    </Header>
			    <SmallContainer width='20%'>
			    	<H1>Phase 1</H1>
			    </SmallContainer>
			    <SmallContainer marginleft='30%' width='70%' >

			   	<ParallaxBackground src={bgimg}>
			   		<Header><H1 big>Phase 1</H1></Header>
			   		<TimelineContainer>
			   			<TimelineItem title='Iron Man' date='05/03/2008' phase='1' color='red'/>
			   			<TimelineItem title='Hulk' date='06/05/2008' phase='1' color='#00F500'/>
			   			<TimelineItem title='Iron Man 2' date='05/03/2010' phase='1' color='#BB0000'/>
			   			<TimelineItem title='Thor' date='05/03/2008' phase='1' color='#2F00A1'/>
			   			<TimelineItem title='Captain America' date='05/03/2011' phase='1' color='blue'/>
			   			<TimelineItem title='Avengers' date='05/03/2012' phase='1' color='#0061FF'/>
			   		</TimelineContainer>
			   	</ParallaxBackground>

			   	<ParallaxBackground src={bgimg2}>
			   		<Header><H1 big>Phase 1</H1></Header>
			   		<TimelineContainer>
			   			<TimelineItem title='Iron Man' date='05/03/2008' phase='1' color='red'/>
			   			<TimelineItem title='Hulk' date='06/05/2008' phase='1' color='#00F500'/>
			   			<TimelineItem title='Iron Man 2' date='05/03/2010' phase='1' color='#BB0000'/>
			   			<TimelineItem title='Thor' date='05/03/2008' phase='1' color='#2F00A1'/>
			   			<TimelineItem title='Captain America' date='05/03/2011' phase='1' color='blue'/>
			   			<TimelineItem title='Avengers' date='05/03/2012' phase='1' color='#0061FF'/>
			   		</TimelineContainer>
			   	</ParallaxBackground>

			   	</SmallContainer>
		    </section>
		);
	}

}

export default Overview;
